import { Footer } from "./../components/footer";
import { Logo } from "./../components/Logo";
import React from "react";
import { bruh } from "../tmp";
import { Tabs, TabList, Tab, TabPanel } from "@mui/joy";

export function Menu({}) {
  return (
    <div>
      <div className="p-[4rem] h-screen w-full flex flex-col justify-center items-center">
        <Logo />
        <Tabs
          aria-label="Basic tabs"
          defaultValue={0}
          size="lg"
          className="w-[50rem] h-[35rem] mt-[15rem]"
          orientation="horizontal"
          sx={{backgroundColor: "white"}}
        >
          <TabList className="flex justify-center" >
            <Tab sx={{color: "#7391A1"}}>Breakfast</Tab>
            <Tab sx={{color: "#7391A1"}}>Lunch</Tab>
            <Tab sx={{color: "#7391A1"}}>Dinner</Tab>
          </TabList>
          <TabPanel value={0}>
            <b>First</b> tab panel
          </TabPanel>
          <TabPanel value={1}>
            <b>Second</b> tab panel
          </TabPanel>
          <TabPanel value={2}>
            <b>Third</b> tab panel
          </TabPanel>
        </Tabs>
      </div>

      <Footer />
    </div>
  );
}
